.preloader {
    position: fixed;
    z-index: 99999999999999999999999999999999999999;
    perspective: 200px;
    background: $secondary;
    left: 0;
    top: 0;
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;

}

  .pre {
    width: 80px;
    height: 80px;
    background: $primary;
    border-radius: 10px;
    transition: all 5s;
    animation: loader 2s linear infinite;
  }

  @keyframes loader {
    0% {
      transform: rotate(0deg);
    }
    50% {
      transform: rotateX(0deg)
                 rotateY(180deg);
    }
    100% {
      transform: rotateX(180deg)
                 rotateY(180deg);
    }
  }

  /*-----------------------*/
  #by {
      margin-top: 1rem;
    color: black;
    font-size: 1rem;
  }
